import React, { useState } from 'react';
import Navbar from '../Components/Navbar';
import BottomHeader from '../Components/BottomHeader';

interface Row {
    id: number;
    name: string;
    age: number;
}

function DataPage() {
    const [tableData, setTableData] = useState<Row[]>([
        // Initial data for the table, you can customize this as needed
        { id: 1, name: 'John', age: 30 },
        { id: 2, name: 'Jane', age: 25 },
        { id: 3, name: 'Doe', age: 40 },
    ]);

    // Function to handle changes in table data
    // Function to handle changes in table data
    // Function to handle changes in table data
    // Function to handle changes in table data
    const handleDataChange = (index: number, field: keyof Row, value: string | number) => {
        const updatedData = [...tableData];
        (updatedData[index] as any)[field] = value; // Type assertion
        setTableData(updatedData);
    };




    return (
        <div className="flex flex-col w-full h-screen items-center custom-background-img-mobile sm:custom-background-img-desktop">
            <Navbar />
            <div className="flex flex-col h-max w-full items-center overflow-y-auto gap-2 pt-8">
                <h2>Data Grid</h2>
                <table>
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>Name</th>
                            <th>Age</th>
                        </tr>
                    </thead>
                    <tbody>
                        {tableData.map((row, index) => (
                            <tr key={index}>
                                <td>{row.id}</td>
                                <td>
                                    <input
                                        type="text"
                                        className="text-black"
                                        value={row.name}
                                        onChange={(e) => handleDataChange(index, 'name', e.target.value)}
                                    />
                                </td>
                                <td>
                                    <input
                                        type="number"
                                        className="text-black"
                                        value={row.age}
                                        onChange={(e) => handleDataChange(index, 'age', parseInt(e.target.value))}
                                    />
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
            <BottomHeader />
        </div>
    );
}

export default DataPage;
